webpackJsonp([0xe51bba3e3df2],{5170:function(e,t){e.exports={data:{post:{html:'<p>PapaScott (the website) is <a href="/1999/12/05">one year old</a> today. Thanks to "Userland" for providing at no cost the <a href="http://www.editthispage.com">webspace</a> and the software that makes it not only possible, but easy.</p>\n<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2000/12/crh1203.jpg" height="262" width="350" border="0" alt="crh1203.jpg: " /></p>\n<p>Our hosts Jörg and Susanne in Munich treated Christopher to a Bavarian breakfast: a fresh pretzel with butter and honey. It was amazing how all three could stick in his hair. And his face. And his clothes.</p>\n<p>Jörg insisted that Christopher roll up his sleeves for the true Bavarian look. At least he didn\'t insist on Lederhosen!</p>',fields:{title:"Back in black",date:"05 Dec 2000",url:"https://papascott.de/2000-12-05-back-in-black/"}}},pathContext:{slug:"/2000-12-05-back-in-black/",prev:{fields:{title:"Weekend Trip",date:"01 Dec 2000",slug:"/2000-12-01-weekend-trip/"}},next:{fields:{title:"Nursery School",date:"06 Dec 2000",slug:"/2000-12-06-nursery-school/"}}}}}});
